import './home.css';

import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { useAuth0 } from '@auth0/auth0-react';

function Home() {
  const { user, isAuthenticated } = useAuth0();
  const [videoId, setVideoId] = useState('nrOIhOsbSDk');  

  useEffect(() => {
    fetch("https://youtube.googleapis.com/youtube/v3/search?part=snippet&channelId=UC7JBG8BXxqTgu6jpeJikImQ&q=nrOIhOsbSDk&key=AIzaSyBvB8S03KRxNVscvlNMLMlMrpM7THvVpyc")
    .then((result) => {
        return result.json(); 
    })
    .then((data) => {
        if (data.items.length > 0) {
          setVideoId(data.items[0].id.videoId); 
        }
    })
    .catch((error) => {
        console.log(error);
    });
  }, []);

  return (
    <div className={'home-container'}>
      <h1 className={'text-center bg-orange text-white'}>Welcome to Puppy Adoption Center!</h1>
      <div className={'row flex jc-c'}>
        <div className={'paper col-6 col-s-10 bg-image'}>
          <div className={'introduction'}>
            <h1>The North Eastern Shelter</h1>
            <div className='contact-info'>
              <p>Phone: 204 123 4567</p> 
              <p>Address: 410 W Georgia St #1400, Vancouver</p>
              <h3 className='user-greeting'>Welcome!</h3>
            </div>
            {!isAuthenticated ? (<div>
              <Link to="/login">
                <button className={'button button-blue'}>
                  Login
                </button>
              </Link> 
              <strong className={'instruction'}>
              <i>
                to start the adoption process.
              </i>
              </strong>
            </div>) : (
            <div className='goProfile'>
              {user && <div> <h3 className='user-greeting'>Welcome, {user.name}!</h3>
        <Link to="/dashboard">Go to MyProfile</Link></div>}</div>)}
            <div className={'available-puppies'}>
              <Link to="/puppies">See Available Puppies</Link>
            </div>
          </div>
          <div className="video-container">
          <iframe title="api" 
            src={`https://www.youtube.com/embed/${videoId}?loop=1&modestbranding=1`}
            width={"80%"}
            height={"320"}
            frameborder={0}
            allowFullScreen>
          </iframe>
          </div>
        </div>
      </div>
    </div>
);
}

export default Home;
